function NewsList(){}NewsList.prototype.deleteBtnEvent=function(){$(".table tbody tr").find(".deleteBtn").click(function(){var e=$(this).parent().parent(),t=$(this).parent().parent().attr("data-news-id");xfzalert.alertConfirm({title:"你是否确定删除?",confirmCallback:function(){xfzajax.post({url:"/cms/news_delete/",data:{news_id:t},success:function(t){200===t.code?(e.empty(),xfzalert.alertSuccessToast("删除成功")):console.log(t.message)}})}})})},NewsList.prototype.initDatepicker=function(){var t=$("#start-datepicker"),e=$("#end-datepicker"),n=new Date,a={showButtonPannel:!0,format:"yyyy/mm/dd",startDate:"2020/03/22",endDate:n.getFullYear()+"/"+(n.getMonth()+1)+"/"+n.getDate(),todayBtn:"linked",todayHighlight:!0,clearBtn:!0,autoclose:!0};t.datepicker(a),e.datepicker(a)},NewsList.prototype.clearInput=function(){$(".clearBtn").click(function(){$("#start-datepicker").val(""),$("#end-datepicker").val(""),$(".titleinput").val("")})},NewsList.prototype.run=function(){var t=this;t.initDatepicker(),t.deleteBtnEvent(),t.clearInput()},$(function(){(new NewsList).run()});